import React from 'react';
import './CalendarEvent.css'; // Import CSS file for styling

function CalendarEvent({ startTime, endTime, title, location, eventType }) {
  // Define a function to calculate the duration of the event
  const calculateDuration = () => {
    // Assuming startTime and endTime are Date objects
    const durationInMinutes = (endTime.getTime() - startTime.getTime()) / (1000 * 60);
    return durationInMinutes;
  };

  // Style the event based on its type
  let eventClassName = 'Event';
  switch (eventType) {
    case 'meeting':
      eventClassName += ' Meeting';
      break;
    case 'party':
      eventClassName += ' Party';
      break;
    case 'workshop':
      eventClassName += ' Workshop';
      break;
    // Add more event types as needed
    default:
      eventClassName += ' Default';
      break;
  }

  return (
    <div className={eventClassName}>
      <div className="Time">{startTime.toLocaleTimeString([], {hour: '2-digit', minute: '2-digit'})} - {endTime.toLocaleTimeString([], {hour: '2-digit', minute: '2-digit'})}</div>
      <div className="Title">{title}</div>
      <div className="Location">{location}</div>
      <div className="Duration">{calculateDuration()} mins</div>
    </div>
  );
}

export default CalendarEvent;
